import React from "react";
import "./App.css";
import { ChakraProvider, Button } from "@chakra-ui/react";
import { BrowserRouter } from "react-router-dom";

import theme from "./thema/thema";

function App() {
  return (
    <ChakraProvider theme={theme}>
      <BrowserRouter>
        <Button>ボタン</Button>
        <p>あああ</p>
      </BrowserRouter>
    </ChakraProvider>
  );
}

export default App;
